import {HttpClient} from "@angular/common/http";
import {Injectable} from "@angular/core";
import {BracketData} from "../models/request/BracketData";

@Injectable({
  providedIn: 'root'
})
export class BracketService {

  constructor(private http: HttpClient) {
  }

  public findBracket(id: number| undefined) {
    return this.http.get<BracketData>('http://localhost:8080/api/open/tournament/bracket/' + id)
  }

  teamWon(teamId: number, bracketId: number, matchId: number) {
    return this.http.get('http://localhost:8080/api/private/admin/tournament/bracket/' + bracketId+ '/match/' + matchId + 'te')
  }
}
